Future<String> _getCompressedData() =>
    http.get(Uri.parse("https://openrouter.ai/api/v1/models")).then((v) {
      int l = v.body.length;
      String o = compress(
        $OpenRouterModelsListResponse.fromJson(v.body).toJson(pretty: false),
        allowBZip2: false,
        allowZLib: false,
      );
      print("$l -> ${o.length}");
      return o;
    });

